import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App" style={{ backgroundColor: '#f0f8ff', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <h1 style={{ fontSize: '3rem', color: '#333' }}>Top Software!</h1>
    </div>
  );
}

export default App;
